import React, { useState, useEffect } from "react";
import Sidebar from "../../templates/sidebar";
import Header from "../../templates/header";
import { useNavigate } from "react-router-dom";
import Modal from "../../../component/Modal";
import { API_URL } from "../../../config";
import axios from "axios";
import closeIcon from "../../../images/close.png";
import { Link } from "react-router-dom";
import MenuFarmasi from "../component/MenuFarmasi";
import DataPenjualan from "./component/DataPenjualan";
import TambahPenjualan from "./component/TambahPenjualan";

const Penjualan = () => {
  const [pagePenjualan, setPagePenjualan] = useState(true);
  const [pagePenjualanSelected, setPagePenjualanSelected] = useState(true);
  const [pageTambahDataPenjualan, setPageTambahDataPenjualan] = useState(false);
  const [pageTambahDataPenjualanSelected, setPageTambahdataPenjualanSelected] =
    useState(false);

  const handlePagePenjualan = () => {
    setPagePenjualan(true);
    setPageTambahDataPenjualan(false);
    setPagePenjualanSelected(true);
    setPageTambahdataPenjualanSelected(false);
  };

  const handlePageTambahData = () => {
    setPageTambahDataPenjualan(true);
    setPagePenjualan(false);
    setPagePenjualanSelected(false);
    setPageTambahdataPenjualanSelected(true);
  };

  return (
    <div class="h-full">
      <div class="flex">
        <div class="flex-none">
          <Sidebar />
        </div>
        <div class="flex-auto bg-dasar border-l-2 border-opacity-30 border-gray-300 shadow-md">
          <Header />
          <MenuFarmasi />

          <div class="container mx-auto 2xl:w-screen px-8 pb-10">
            <div className="container border border-state-300 bg-white p-2 mt-2  ">
              <div className="flex justify-end mb-4 ">
                <button
                  onClick={handlePagePenjualan}
                  className={`py-0.2 text-sm  px-1 mr-1   hover:bg-emerald300 border-black ${
                    pagePenjualanSelected
                      ? `bg-emerald300 text-black `
                      : `bg-white border text-black `
                  }`}
                  type="button"
                >
                  DATA PENJUALAN
                </button>
                <button
                  onClick={handlePageTambahData}
                  className={`py-0.2 text-sm  px-1 mr-1   hover:bg-emerald300 border-black ${
                    pageTambahDataPenjualanSelected
                      ? `bg-emerald300 text-black `
                      : `bg-white border text-black `
                  }`}
                  type="button"
                >
                  TAMBAH DATA
                </button>
              </div>
              <div className="search text-left flex">
                <div className="search text-left flex ">
                  <form>
                    <input
                      //   onChange={handleSearchPasienRanapChange}
                      //   value={searchQueryPasienRanap}
                      className="border border-black pl-0.5 py-0.4  "
                      type="text"
                      placeholder="Cari pasien rawat inap..."
                    />
                  </form>
                </div>
                <div className="container mx-auto w-full flex justify-end ">
                  <button
                    // onClick={() => setPage((page) => page - 1)}
                    // hidden={page === 1}
                    type="button"
                    class="bg-white text-state-400 rounded-l-md border border-black border-l  mr-1"
                  >
                    <div class="flex flex-row align-middle">
                      <svg
                        class="w-4 mr-1 mt-0.5"
                        fill="currentColor"
                        viewBox="0 0 20 20"
                        xmlns="http://www.w3.org/2000/svg"
                      >
                        <path
                          fill-rule="evenodd"
                          d="M7.707 14.707a1 1 0 01-1.414 0l-4-4a1 1 0 010-1.414l4-4a1 1 0 011.414 1.414L5.414 9H17a1 1 0 110 2H5.414l2.293 2.293a1 1 0 010 1.414z"
                          clip-rule="evenodd"
                        ></path>
                      </svg>
                      <p class="ml-0.5 mr-1 text-sm">Prev</p>
                    </div>
                  </button>

                  <button
                    // onClick={() => {
                    //   setPage((page) => page + 1);
                    // }}
                    // hidden={page === totalPages}
                    type="button"
                    class="bg-white text-state-400 border border-black rounded-r-md border-l "
                  >
                    <div class="flex flex-row align-middle">
                      <p class="mr-0.5 ml-0.5 text-sm">Next</p>
                      <svg
                        class="w-4 mr-1 mt-0.5"
                        fill="currentColor"
                        viewBox="0 0 20 20"
                        xmlns="http://www.w3.org/2000/svg"
                      >
                        <path
                          fill-rule="evenodd"
                          d="M12.293 5.293a1 1 0 011.414 0l4 4a1 1 0 010 1.414l-4 4a1 1 0 01-1.414-1.414L14.586 11H3a1 1 0 110-2h11.586l-2.293-2.293a1 1 0 010-1.414z"
                          clip-rule="evenodd"
                        ></path>
                      </svg>
                    </div>
                  </button>
                </div>
              </div>
              <div class="overflow-x-auto mb-5 ">
                {pagePenjualan && <DataPenjualan />}

                {pageTambahDataPenjualan && <TambahPenjualan />}
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Penjualan;
